import React from "react"


export default function Register () {
    return (
       <form>
           <label htmlFor="name">
               Username: 
               <input
                    type= "text"
                    name="name"
                    id="name"
                    placeholder="Enter Your UserName"
                    // value={}
                    // onChange={}
                />
           </label>

           <label htmlFor="email">
           Email:
               <input
                type="email"
                name="email"
                id="email"
                placeholder="Enter Your Email"
                // value={}
                // onChange={}
                />
           </label>

           <label htmlFor="password">
           Password:
               <input
                    type="password"
                    name="password"
                    id="password"
                    placeholder="Enter Your Password"
                    // value={}
                    // onChange={}

                 />
           </label>
           <label htmlFor="conPassword">
           Confirm Your Password:
                <input
                    type="password"
                    name="conPassword"
                    id="conPassword"
                    placeholder="Confirm Your Password"
                    // value={}
                    // onChange={}

                 />
           </label>

           <label>
               <input
                    type="checkbox"


                />
           </label>
       </form>
    )
}
